sys_variable_value.value:
(function execute(inputs, outputs) {

// ... code ...

  var credential = new GlideRecord('discovery_credentials');

  credential.get(inputs.credRec.sys_id);

  var pwd = inputs.newPass.toString();

  credential.password.setDisplayValue(pwd);
  outputs.credential_sys_id = credential.update();

})(inputs, outputs);

